USE vghoghariorg;

CREATE TABLE `app_states` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `code` int(11) NOT NULL,
  `name` varchar(200) NOT NULL,
  `value` varchar(200) DEFAULT NULL,
  `country_id` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `country_id` (`country_id`),
  CONSTRAINT `app_states_ibfk_1` FOREIGN KEY (`country_id`) REFERENCES `app_countries` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=4120 DEFAULT CHARSET=utf8;


